  render() {
    return (
      <View style={styles.container}>
        {/* <BackButton /> */}
        <QuickExit />
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    marginBottom: "8%",
    marginRight: "2%",
    padding: 20,
    alignItems: "center",
    justifyContent: "center", //Here is the trick
    bottom: 0, //Here is the trick
